import Day from './Day'

function Calendar({ month }) {
  return (
    <table>
      <thead>
        <tr>
          <th>{month}</th>
        </tr>
      </thead>
      <tbody>
          <tr>
             <Day date="1">

             </Day>
          </tr>
      </tbody>
    </table>
  );
}

export default Calendar;
